module.exports = "<main>\r\n  <h3 class=\"text-center mat-title\">{{title}}</h3>\r\n  <mat-card class=\"container-fluid p-0\">\r\n    <mat-tab-group mat-align-tabs=\"center\">\r\n      <mat-tab label=\"¿Cómo nació Brige?\">\r\n        <div class=\"pt-1 pb-1 pr-3 pl-3\">\r\n          <h4 class=\"mt-2 mat-headline\">Idea inicial</h4>\r\n          <p class=\"text-justify mat-body-1\">\r\n            Este plataforma surgio como la iniciativa de un grupo de personas que vieron una\r\n            oportunidad en el mercado para el comercio de vehículos usados, al ver que era posible generar una\r\n            plataforma web distinta a las existentes.\r\n          <p>\r\n          <p class=\"text-justify mat-body-1\">\r\n            La idea inicial consistia en que las personas pudieran ofrecer de manera segura sus\r\n            vehículos por medio de un sitio web, para que de esta forma otras personas tuvieran la capacidad de\r\n            adquirirlos de manera sencilla y que la entrega de dicho vehículo fuera flexible, es decir, que el vendedor\r\n            y comprador del vehículo tuvieran la oportunidad de acordar la entrega del vehículo o que la entrega del\r\n            vehículo se hiciera por medio de los proveedores que se cuentan en el sitio web, proporcionando así\r\n            facilidad para las personas de promocionar sus vehículos en venta y, a su vez, facilitando la compra de un\r\n            vehículo para aquellas personas que buscan adquirir uno.\r\n          </p>\r\n          <h4 class=\"mt-2 mat-headline\">Creadores</h4>\r\n          <p class=\"mat-body-1\">Los creadores de esta iniciativa fueron las siguientes personas: </p>\r\n          <mat-tab-group mat-align-tabs=\"center\">\r\n            <mat-tab *ngFor=\"let integrante of creadores\" label=\"{{integrante.nombre}}\">\r\n              <div class=\"text-center\">\r\n                <img class=\"rounded-circle d-inline\" [src]=\"integrante.imagen\" style=\"width: 200px; height: auto;\"\r\n                     alt=\"Foto de {{integrante.nombre}}\">\r\n              </div>\r\n              <h5 class=\"text-center\">{{integrante.nombre}}</h5>\r\n              <div class=\"mb-3 d-flex justify-content-around\">\r\n                <a mat-mini-fab matTooltip=\"Facebook\" color=\"primary\" class=\"p-0\"><i class=\"fab fa-facebook-f\"></i></a>\r\n                <a mat-mini-fab matTooltip=\"Twitter\" color=\"primary\" class=\"p-0\"><i class=\"fab fa-twitter\"></i></a>\r\n                <a mat-mini-fab matTooltip=\"Instagram\" color=\"primary\" class=\"p-0\"><i class=\"fab fa-instagram\"></i></a>\r\n              </div>\r\n            </mat-tab>\r\n          </mat-tab-group>\r\n        </div>\r\n      </mat-tab>\r\n      <mat-tab label=\"¿Qué te ofrecemos?\">\r\n        <div class=\"pt-1 pb-1 pr-3 pl-3\">\r\n          <h4 class=\"mt-2 mat-subheading-1\">Esto es lo que tenemos para ti</h4>\r\n          <p class=\"text-justify mat-body-1 mat-body-1\">\r\n            El objetivo del sitio web es la creación de una plataforma para la compra y venta de\r\n            vehículos amigable e intuitiva que les permita realizar pedidos, tanto desde una página web como una\r\n            aplicación móvil, logrando esto mediante herramientas de accesibilidad que facilitará su uso para\r\n            personas con dificultades visuales.\r\n          </p>\r\n          <p class=\"text-justify mat-body-1 mat-body-1\">\r\n            La plataforma espera captar la atención del público adulto que busca comprar o\r\n            vender vehículos usados, mediante una interfaz que les brinde confianza y que sea de su agrado, además se\r\n            busca que el sitio web tenga una interfaz que ayude a personas con problemas de la vista a que puedan\r\n            interactuar con el, por ejemplo, poder hacer el cambio de colores, tamaño de fuente, tipo de letra, entre\r\n            otros aspectos, para que sea mas fácil visualizar la información y elementos del sitio web.\r\n          </p>\r\n          <p class=\"text-justify mat-body-1 mat-body-1\">\r\n            Cabe mencionar que, al tratarse de vehículos usados, el sitio web dará la opción de\r\n            acordar un punto de encuentro con el vendedor para hacer la entrega del vehículo, así como se proporcionara\r\n            el envío a domicilio por medio de un proveedor del sitio con un costo extra, lo cual proporcionará\r\n            flexibilidad para la compra de los autos al momento de su entrega, tanto para el vendedor como para el\r\n            comprador.\r\n          </p>\r\n          <p class=\"text-justify mat-body-1 mat-body-1\">\r\n            Además, el sitio web generará códigos QR de los autos listados en la plataforma. La\r\n            idea detrás de esto es que estos puedan ser desplegados en los vehículos y ser escaneados por la\r\n            aplicación móvil para acceder directamente a la página de venta de dicho auto, lo cuál ahorrará tiempo\r\n            de navegación y servirá como una forma de verificar que el auto que el usuario va a comprar sea realmente\r\n            el que se muestra en la plataforma, lo cual beneficiará tanto a la confiabilidad en el uso de la página\r\n            como la de sus vendedores.\r\n          </p>\r\n          <div class=\"d-flex justify-content-between\">\r\n            <div class=\"col-4 text-center\">\r\n              <i class=\"fas fa-qrcode fa-5x text-muted\"></i>\r\n            </div>\r\n            <div class=\"col-4 d-inline-block align-middle m-auto p-0\">\r\n              <i class=\"fas fa-arrow-right fa-3x left-to-right text-muted\"></i>\r\n            </div>\r\n            <div class=\"col-4 text-center\">\r\n              <i class=\"fas fa-car-side fa-5x text-muted\"></i>\r\n            </div>\r\n          </div>\r\n          <p class=\"text-justify mat-body-1 mt-2\">Es importante resaltar que proveemos confianza para los usuarios del\r\n            sitio, pues\r\n            constantemente estamos revisando la actividad de las ventas para asegurar que las compras que se realicen\r\n            obtengan su vehículo de manera satisfactoria y no existan fraudes.\r\n          </p>\r\n        </div>\r\n      </mat-tab>\r\n      <mat-tab label=\"Nuestra visión\">\r\n        <div class=\"pt-1 pb-1 pr-3 pl-3\">\r\n          <h4 class=\"mt-2\">Visión</h4>\r\n          <p class=\"text-justify mat-body-1\">Para los creadores de este sitio web no solamente es importante que las\r\n            personas\r\n            lleven a cabo sus ventas y compras de vehículos, si no que tambíen es importante la comodidad del usuario,\r\n            es decir, les parece de gran relevancia la necesidad de que la experiencia de cada una de las personas sea\r\n            agradable y amigable, con la intención de que tengan el deseo de volver a hacer uso del sitio y queden\r\n            satisfechos cuando lo hagan, tratando de que el esta herramineta sea del agrado de la mayoría de las\r\n            personas.\r\n          </p>\r\n          <p class=\"text-justify mat-body-1\">La plataforma esta pensada con opciones que permiten dar flexibilidad y\r\n            comodidad,\r\n            como lo son la selección de temas (colores del sitio web) para personas con algún tipo de discapacidad\r\n            visual, así como permitir la navegación del sitio y realización de pedidos por comandos de voz, de esta\r\n            manera innovando e incorporando herramientas nuevas que permiten una interacción más cómoda e intuitiva con\r\n            el sitio web.\r\n          </p>\r\n          <p class=\"text-justify mat-body-1\">Es importante resaltar que proveemos confianza para los usuarios del sitio,\r\n            pues\r\n            constantemente estamos revisando la actividad de las ventas para asegurar que las compras que se realicen\r\n            obtengan su vehículo de manera satisfactoria y no existan fraudes.\r\n          </p>\r\n          <p class=\"text-justify mat-body-1\">A grandes rasgos, esta en la visión que se tiene del sitio web, lo cual es\r\n            buscar la\r\n            comodidad, confianza y felicidad del usuario, porque para nosotros tu eres lo más importante.\r\n          </p>\r\n        </div>\r\n      </mat-tab>\r\n    </mat-tab-group>\r\n  </mat-card>\r\n</main>\r\n"

